// Generated by Mochi transpiler
List<int> bigTrim(List<int> a) {
  int n = a.length;
  while (n > 1 && a[n - 1] == 0) {
    a = a.sublist(0, n - 1);
    n = n - 1;
  }
  return a;
}

List<int> bigFromInt(int x) {
  if (x == 0) {
    return [0];
  }
  List<int> digits = [];
  int n = x;
  while (n > 0) {
    digits = [...digits, n % 10];
    n = n ~/ 10;
  }
  return digits;
}

List<int> bigAdd(List<int> a, List<int> b) {
  List<int> res = [];
  int carry = 0;
  int i = 0;
  while (i < a.length || i < b.length || carry > 0) {
    int av = 0;
    if (i < a.length) {
    av = a[i];
  }
    int bv = 0;
    if (i < b.length) {
    bv = b[i];
  }
    int s = av + bv + carry;
    res = [...res, s % 10];
    carry = s ~/ 10;
    i = i + 1;
  }
  return bigTrim(res);
}

List<int> bigSub(List<int> a, List<int> b) {
  List<int> res = [];
  int borrow = 0;
  int i = 0;
  while (i < a.length) {
    int av = a[i];
    int bv = 0;
    if (i < b.length) {
    bv = b[i];
  }
    int diff = av - bv - borrow;
    if (diff < 0) {
    diff = diff + 10;
    borrow = 1;
  } else {
    borrow = 0;
  }
    res = [...res, diff];
    i = i + 1;
  }
  return bigTrim(res);
}

String bigToString(List<int> a) {
  String s = "";
  int i = a.length - 1;
  while (i >= 0) {
    s = s + (a[i]).toString();
    i = i - 1;
  }
  return s;
}

int minInt(int a, int b) {
  if (a < b) {
    return a;
  } else {
    return b;
  }
}

List<List<int>> cumu(int n) {
  List<List<List<int>>> cache = [[bigFromInt(1)]];
  int y = 1;
  while (y <= n) {
    List<List<int>> row = [bigFromInt(0)];
    int x = 1;
    while (x <= y) {
    final val = cache[y - x]![minInt(x, y - x)];
    row = [...row, bigAdd(row[row.length - 1], val)];
    x = x + 1;
  }
    cache = [...cache, row];
    y = y + 1;
  }
  return cache[n];
}

List<String> row(int n) {
  final List<List<int>> e = cumu(n);
  List<String> out = [];
  int i = 0;
  while (i < n) {
    final List<int> diff = bigSub(e[i + 1], e[i]);
    out = [...out, bigToString(diff)];
    i = i + 1;
  }
  return out;
}

int x = 1;
void main() {
  print("rows:");
  while (x < 11) {
    final List<String> r = row(x);
    String line = "";
    int i = 0;
    while (i < r.length) {
    line = line + " " + r[i] + " ";
    i = i + 1;
  }
    print(line);
    x = x + 1;
  }
  print("");
  print("sums:");
  for (var num in [23, 123, 1234]) {
    final List<List<int>> r = cumu(num);
    print((num).toString() + " " + bigToString(r[r.length - 1]));
  }
}
